app.controller("check_anonym",["$scope","$stateParams","serviceAPIService","employeeAPIService","consumedServiceAPIService","dialogService",function(n,t,i,r,u,f){n.title="匿名买单";n.routeName="service_select";n.serviceId=t.serviceId;n.service=null;n.beauticians=null;n.selectedBeautician=null;n.check={payment:null,time:1,serviceId:n.serviceId,employeeId:null,changeTimeReason:null};i.getService(n.serviceId).then(function(t){n.service=t.data});r.getBeauticians().then(function(t){n.beauticians=t.data});n.selectBeautician=function(t){n.selectedBeautician=t};n.submit=function(){n.check.employeeId=n.selectedBeautician.employeeId;u.checkAnonym(n.check).then(function(){f.showMention(1,"匿名买单记账成功","customers")})}}]);